            function cargcli(event){
                document.getElementById("txtnombres").value = "";
                document.getElementById("txtdireccion").value = "";
                document.getElementById("txtcuenta").value = "";
                if (event.which == 13 || event.keyCode == 13) {
                    var txtcedu = {txtcedu:document.getElementById("txtcliente").value};
                    $.getJSON("../buscar", txtcedu, function(res, est, jqXHR){
                        if(res.length > 0){
                            document.getElementById("txtnombres").style.display = "block";
                            document.getElementById("txtdireccion").style.display = "block";
                            document.getElementById("txtcuenta").style.display = "block";
                            document.getElementById("txtcliente").disabled = true;
                            document.getElementById("infoauto").style.display = "block";
                            $.each(res, function(i, item){
                                if(i == 0 || i == 1){ document.getElementById("txtnombres").value += item+" "; }
                                if(i == 6 || i == 7 || i == 8) { document.getElementById("txtdireccion").value += item+" "; }
                                if(i == 12 || i == 13 ) { document.getElementById("txtcuenta").value = item+" "+document.getElementById("txtcuenta").value; }
                                if(i == 11 && item == 0){   alert("Cliente esta de Baja");
                                                            document.getElementById("txtnombres").style.display = "none";
                                                            document.getElementById("txtdireccion").style.display = "none";
                                                            document.getElementById("txtcuenta").style.display = "none";
                                                            document.getElementById("txtcliente").disabled = false;
                                                            document.getElementById("txtcliente").value = "";
                                                            document.getElementById("infoauto").style.display = "none";
                                                        }
                                if(i==11 && item !=0){ cargacmbzonas(); }
                            });
                        } else { document.getElementById("txtcliente").value = ""; alert("no existe cliente"); }
                    });
                }
            }
            
            
